	 ('1118','Nirmatrelvir + Ritonavir','Nirmatrelvir + Riton','000000000','P_Nirmatrelvir + Ritonavir',NULL,NULL,'Simvastatin 함유제제','Simvastatin 함유제제','000000000','P_Simvastatin 함유제제',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1. 금기사유: 횡문근 융해증을 포함하는 근육병증의 잠재적인 가능성, 이 약의 투여 시작으로부터 최소 12시간 전에 심바스타틴의 사용을 중단할 것  2. 환자의 안전한 의약품 사용을 위해 병용투여를 금지하여 주시기 바랍니다.',NULL,NULL,'O','BATCH','2026-02-10 11:27:38.187946','BATCH','2026-02-10 11:27:38.187946'),
	 ('1119','Nirmatrelvir + Ritonavir','Nirmatrelvir + Riton','000000000','P_Nirmatrelvir + Ritonavir',NULL,NULL,'St. john’s wort 함유제제','St. john’s wort 함유제제','000000000','P_St. john’s wort 함유제제',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1. 금기사유: 바이러스 반응의 손실 및 내성 발현의 잠재적인 가능성  2. CYP3A 유도제의 지연된 효과(offset)로 인해, 중단한 직후에도 팍스로비드를 투여할 수 없습니다.',NULL,NULL,'O','BATCH','2026-02-10 11:27:38.187946','BATCH','2026-02-10 11:27:38.187946'),
	 ('1120','Nirmatrelvir + Ritonavir','Nirmatrelvir + Riton','000000000','P_Nirmatrelvir + Ritonavir',NULL,NULL,'Rifampicin 함유제제','Rifampicin 함유제제','000000000','P_Rifampicin 함유제제',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1. 금기사유: 바이러스 반응의 손실 및 내성 발현의 잠재적인 가능성, 리파부틴과 같은 다른 항균제로의 대체를 고려할 것  2. CYP3A 유도제의 지연된 효과(offset)로 인해, 중단한 직후에도 팍스로비드를 투여할 수 없습니다.',NULL,NULL,'O','BATCH','2026-02-10 11:27:38.187946','BATCH','2026-02-10 11:27:38.187946'),
